      this.swiperReset = false;
      this.$nextTick(() => {
        this.swiperReset = true;
      });

      if (this.$refs.swiper) {
        this.$refs.swiper.$swiper.slideTo(0);

        $(".feature-slide-caption").text(
          this.active_feature.f_slides[this.$refs.swiper.$swiper.activeIndex]
            .s_caption
        );
      }
    },
    slideChange() {
      const caption = $(
        this.$refs.swiper.$swiper.slides[this.$refs.swiper.$swiper.activeIndex]
      )
        .find("p")
        .text();

      $(".feature-slide-caption").text(caption);
    },
  },
  mounted() {
    setTimeout(() => {
      this.setActiveFeature("制震精工");
    }, 1000);
  },
};
